import React from 'react'
import {Form, Input, Button} from 'antd';
import {UserOutlined, LockOutlined, InboxOutlined} from '@ant-design/icons';
import {connect} from 'react-redux';
import styled from 'styled-components';

const UpdateProfileFormrapper = styled.div`

    margin:3rem 0;

`;

const UpdateProfileForm = () => {

    const onFinish = (e) => {
       console.log(e)
    }
    return (
        <UpdateProfileFormrapper>
            <Form onFinish={onFinish}>

                <Form.Item hasFeedback name="firstName"
                    rules={
                        [{
                                required: true,
                                message: 'Please input your first name!'
                            }]
                }>
                    <Input prefix={<UserOutlined/>}
                        placeholder="First Name"
                        allowClear/>
                </Form.Item>

                <Form.Item hasFeedback name="lastName"
                    rules={
                        [{
                                required: true,
                                message: 'Please input your last name!'
                            }]
                }>
                    <Input prefix={<UserOutlined/>}
                        placeholder="Last Name"
                        allowClear/>
                </Form.Item>

                <Form.Item hasFeedback name="email"
                    rules={
                        [{
                                required: true,
                                message: 'Please input your email!'
                            }]
                }>
                    <Input prefix={<InboxOutlined/>}
                        placeholder="Email"
                        type="email"
                        allowClear/>
                </Form.Item>

                <Form.Item hasFeedback name="password"
                    rules={
                        [{
                                required: true,
                                message: 'Please input your Password!'
                            }]
                }>
                    <Input prefix={<LockOutlined/>}
                        type="password"
                        placeholder="Password"
                        allowClear/>
                </Form.Item>

                <Form.Item>
                    <Button type="primary" htmlType="submit" className="login-form-button">
                        Update
                    </Button>
                </Form.Item>
            </Form>
        </UpdateProfileFormrapper>
    )
}


export default connect(null, {})(UpdateProfileForm)
